import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Header from "../HomeComponents/Header";
import Footer from "../HomeComponents/Footer";

const UserProfile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserProfile = async () => {
      const token = localStorage.getItem("token");
      if (!token) {
        navigate("/login");
        return;
      }

      try {
        const response = await fetch("http://localhost:3000/api/users/profile", {
          method: "GET",
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
          },
        });

        if (response.ok) {
          const data = await response.json();
          setUser(data.user);
        } else {
          setError("Failed to fetch user data.");
        }
      } catch (error) {
        setError("Error fetching user data.");
      } finally {
        setLoading(false);
      }
    };

    fetchUserProfile();
  }, [navigate]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <>
      <Header />
      <div className="container mx-auto p-4">
        <div className="flex flex-col md:flex-row items-center md:items-start md:space-x-8">
          {/* Profile Avatar */}
          <div className="flex flex-col items-center">
            <div className="relative w-32 h-32 mb-4">
              {/* Placeholder for avatar */}
              {user?.avatar ? (
                <img src={user.avatar} alt="User Avatar" className="w-full h-full rounded-full" />
              ) : (
                <div className="w-full h-full bg-gray-300 rounded-full flex items-center justify-center">
                  <span className="text-3xl">ðŸ‘¤</span>
                </div>
              )}
            </div>
            <h2 className="text-xl font-bold">{user?.name || "User Name"}</h2>
            <p className="text-sm text-gray-600">{user?.role || "Role"}</p>
            <button className="mt-4 bg-purple-500 text-white py-2 px-4 rounded">View Public Profile</button>
          </div>

          {/* User Info Form */}
          <div className="w-full md:w-2/3">
            <h3 className="text-lg font-semibold mb-4">Account</h3>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <label className="block text-gray-600">Name</label>
                <input type="text" value={user?.name || ""} className="border border-gray-300 p-2 rounded w-full" readOnly />
              </div>
              <div>
                <label className="block text-gray-600">Email Address</label>
                <input type="text" value={user?.email || ""} className="border border-gray-300 p-2 rounded w-full" readOnly />
              </div>
              <div>
                <label className="block text-gray-600">Phone Number</label>
                <input type="text" value={user?.phoneNumber || ""} className="border border-gray-300 p-2 rounded w-full" readOnly />
              </div>
              <div>
                <label className="block text-gray-600">Role</label>
                <input type="text" value={user?.role || ""} className="border border-gray-300 p-2 rounded w-full" readOnly />
              </div>
              <div className="col-span-2">
                <label className="block text-gray-600">Password</label>
                <input type="password" value="********" className="border border-gray-300 p-2 rounded w-full" readOnly />
              </div>
            </div>
            <button className="mt-4 bg-purple-500 text-white py-2 px-4 rounded">Edit</button>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default UserProfile;
